import React from 'react'
import { View, Image } from 'react-native'
import styles from "./styles"

const ProfilePicture = () => {
    return (
        <View>
            <Image 
               source={{uri:"https://picsum.photos/200/300"}}
               style={styles.image}></Image>
            
        </View>
    )
}

export default ProfilePictures
